import React from 'react';
import GoogleMapReact from 'google-map-react';


class HeatMap extends React.Component {

    toronto = {
        lat: -79.3832,
        lng: 43.6532
    }

    static defaultProps = {
        center : toronto,
        zoom : 6
    };

    render() {
        return(
            <div style={{ height: '100vh', width: '100%' }}>
                <GoogleMapReact
                bootstrapURLKeys={{ key: "AIzaSyDtxAtICzrgcWE9ntlfGjudzCdNzY7IN5c" }}
                defaultCenter={this.props.center}
                defaultZoom={this.props.zoom}
                >
                <AnyReactComponent
                    lat={59.955413}
                    lng={30.337844}
                    text="My Marker"
                />
                </GoogleMapReact>
            </div>
        )
    }
}


export default HeatMap;
